ポーチやペンケースに入るスマートなペンシルタイプの５段連結スタンプです。<br>
浸透印なのでスタンプ台要らず！ <br>
お手紙やカードに添えて♪<br>
必要が無くてもポン！とひと押し・・読んでね～＾＾<br><br>


